import { VictoryLine } from "victory";

export function DefaultLineChart(props){
    const {border="1px solid #ccc"} = props
    return (<VictoryLine 
        animate={{
            duration: 2000,
            onLoad: { duration: 1000 }}}
        style={{data: {stroke:props.lineColor, parent: { border:{border}}}}}/>)
}
